import React from 'react';
import "./Jambotron.css";
import bgImage from '../assets/header-bg.jpg';

function Jumbotron(){
  return(
    <div class="jumbotron jumbotron-fluid">
      <div class="container">
      <img src={bgImage}/>
        <h1 class="display-4">Welcome!</h1>
      </div>
    </div>
  );
}

export default Jumbotron;
